import React from 'react';
import styled from 'styled-components'

const Button = styled.button`
height:50px;
width: 200px;
border: none;
background: green;
margin: 0 auto;
`

const Wrapper = styled.div`
height:70vh;
width: 100vw;
text-align:center;
`

function Cta() {
    return (
        <Wrapper>
            <Button>KLIKNI ME</Button>
        </Wrapper>
    );
}

export default Cta;
